function submitContato(){var t=$("#contato-nome").val(),o=$("#contato-email").val(),a=$("#contato-empresa").val(),e=$("#contato-tel").val(),n=$("#contato-assunto").val(),c=$("#contato-mensagem").val();$.ajax({type:"POST",url:"./contato/contato.php",data:"contato-nome="+t+"&contato-email="+o+"&contato-empresa="+a+"&contato-tel="+e+"&contato-assunto="+n+"&contato-mensagem="+c,success:function(t){"success"==t?contatoSuccess():contatoError()}})}function contatoSuccess(){$("#etka_contato-enviado").removeClass("etka_contato-enviado"),$("#contato-nome, #contato-email, #contato-empresa, #contato-tel, #contato-assunto, #contato-mensagem").val("")}function contatoError(){$("#etka_contato-erro").removeClass("etka_contato-erro")}$("#etka_contato").submit(function(t){var o=document.forms.etka_contato["contato-email"].value,a=document.getElementById("contato-email"),e=document.forms.etka_contato["contato-mensagem"].value,n=document.getElementById("contato-mensagem"),c=document.createAttribute("required");return""==o?(a.setAttributeNode(c),!1):""==e?(n.setAttributeNode(c),!1):void(t.isDefaultPrevented()?contatoError():(t.preventDefault(),submitContato()))});